}}

==Loot==
At current [[Grand Exchange]] prices, opening an earth impling jar gives {{Coins|{{ImpValue|earth|jar=yes}} round 0}} worth of loot, on average. This means opening earth impling jars marks an average profit of {{Coins|{{ImpValue|earth|jar=yes}}-{{GEP|Earth impling jar}} round 0}} per jar, however this does not include loot from clue scrolls.

On average, one would profit {{Coins|100*({{ImpValue|earth|jar=yes}}-{{GEP|Earth impling jar}}) round 0}} to get a [[clue scroll (medium)|medium clue scroll]] from earth impling jars at current [[Grand Exchange]] prices, excluding the rewards from the completed [[Treasure Trail]]s.

